import React from 'react';


const Nav = () => (

    <nav class="main-nav">
        <ul>
          <li><Navlink to='/ocean'>Oceans</Navlink></li>
          <li><Navlink to='/river'>Rivers</Navlink></li>
          <li><Navlink to='/lake'>Lakes</Navlink></li>
        </ul>
     </nav>

);

export default Nav;
